                <th>City</th>
                <th>Phone</th>
                <th>Address</th>
                <th>Country</th>
            </tr>
        </thead>
        <tbody>
        {% for address in addresses %}
            <tr>
                <td>{{ address.id }}</td>
                <td>{{ address.firstName }}</td>
                <td>{{ address.lastName }}</td>
                <td>{{ address.codePostal }}</td>
                <td>{{ address.city }}</td>
                <td>{{ address.phone }}</td>
                <td>{{ address.address }}</td>
                <td>{{ address.country }}</td>
                <td>
